import axios from "axios";

const instance = axios.create({
    baseURL: "http://13.290.65.163:8080",
    timeout: 3000,
    headers: {
        "Content-Type": "application/json",
        // Authorization: "Bearer your_access_token",
    },
});

export default instance;
